#!/usr/bin/env python3
def isAnagram(s, t):
        """
        :type s: str
        :type t: str
        :rtype: bool
        """
        if len(s) != len(t):
            return False
        
        v_array = [0 for i in range(0, len(s))]
        s_list = [*s]
        for tLetter in t:
            for sLetter in range(0, len(s_list)):
                if tLetter == s_list[sLetter] and v_array[sLetter] == 0:
                    v_array[sLetter] = 1
                    break
        
        if 0 in v_array:
            return False
        else:
            return True


s = ""
t = ""
print(isAnagram(s, t))